export default {
    namespaced:true,
    state:{
        userData:[],
        countyOption:[
            {
                id: 1,
                county: '定海区'
            }, 
            {
                value: 2,
                label: '普陀区'
            }, 
            {
                value: 3,
                label: '岱山县'
            }, 
            {
                value: 4,
                label: '嵊泗县'
            }, 
        ],
        townData:[],
        villageData:[],
    },
    mutations:{
        setUserData(state,data){
            state.userData=data
        }
        
    }

}
